post_content = "<h3>Frontier Services Outback Links</h3>
<h3>Description</h3>
Outback Links has been linking volunteers with individuals in remote Australia who are struggling for decades. We offer practical assistance when it is most required. This could be everything from child care to property upkeep, gardening to painting, or simply providing basic farm support. Everyone has the potential to make a significant difference.
<h3>Eligibility</h3>
Available to farmers, volunteers
<h3>How to apply</h3>
Call 1300787247 or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://frontierservices.org/contact/\">HERE</a>.
<figure>
											<a href=\"https://frontierservices.org/\" target=\"_blank\" rel=\"noopener\">
<img width=\"512\" height=\"512\" src=\"/wp-content/uploads/2021/08/6.png\" alt=\"\" loading=\"lazy\">								</a><figcaption></figcaption></figure>
<h4>Contact</h4>
<ul>
 	<li>
											<a href=\"tel:1300787247\">
1300787247
</a></li>
 	<li>
											<a href=\"https://frontierservices.org/\">
frontierservices.org/
</a></li>
 	<li>
										fsfundraising@frontierservices.org</li>
</ul>"
